import React, { useReducer } from "react";
import classes from "./CartItem.module.css";

const BtnSort = {
  Add: false,
  Remove: false,
};

const Btnreducer = (state, action) => {};

const CartItem = (props) => {
  const onclickAddBtn = (e) => {};

  const onclickRemoveBtn = (e) => {};

  return (
    <React.Fragment>
      <li className={classes.itemlist}>
        <div>
          <h2 className={classes.itemname}>{props.name}</h2>
          <span className={classes.itemprice}>${props.price}</span>
          <span className={classes.itemamount}>x {props.amount}</span>
        </div>
        <span className={classes.minplusbtn}>
          <button className={classes.minusbtn} onClick={onclickAddBtn}>
            -
          </button>
          <button className={classes.plusbtn} onClick={onclickRemoveBtn}>
            +
          </button>
        </span>
      </li>
    </React.Fragment>
  );
};

export default CartItem;
